
CREATE TABLE `company_daily` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `company` mediumint default NULL,
  `server` mediumint default NULL,
  `year` TEXT default NULL,
  `month` mediumint default NULL,
  `day` mediumint default NULL,
  `activity_sum` mediumint default NULL,
  `install_sum` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

